import OrderCard from './OrderCard';

export default function OrderList({ orders }) {
  if (orders.length === 0) {
    return <p>❌ Chưa có đơn hàng</p>;
  }

  return (
    <>
      {orders.map((o) => (
        <OrderCard key={o.orderId} order={o} />
      ))}
    </>
  );
}
